INSERT INTO `question` VALUES (1,1,NULL,'What is the missing value in the given sequence: 1, 2, 3, 4, ?, 6, 7, 8, 9',NULL,NULL,1,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(2,1,NULL,'Find the missing number in the sequence: 1, 3, 5, ?, 9, 11, 13.\r\n',NULL,NULL,1,'2020-09-06 06:18:54',0,NULL,'2020-09-16 07:29:58'),(3,1,NULL,'Find the missing number in the sequence: 2, 4, 6, 8, ?, 12, 14, 16, 18.',NULL,NULL,1,'2020-09-06 06:18:54',0,NULL,'2020-09-16 07:29:58'),(4,1,NULL,'Find the missing number in the sequence: 3, 6, 9, ?, 15, 18, 21.',NULL,NULL,1,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(5,1,NULL,'Find the missing number in the sequence: 1, 4, 9, 16, ?, 36, 49, 64.',NULL,NULL,1,'2020-09-06 06:18:54',0,NULL,'2020-09-16 07:29:58'),(6,1,NULL,'Find the missing number in the sequence: 0, 1, 1, 2, 3, 5, 8, ?, 21, 34, 55.',NULL,NULL,1,'2020-09-06 06:18:54',0,NULL,'2020-09-16 07:29:58'),(7,1,NULL,'What is the next number in this sequence: 1, 3, 9, 27, 81, 243, ?.',NULL,NULL,1,'2020-09-06 06:18:54',0,NULL,'2020-09-16 07:29:58'),(8,1,NULL,'Find the missing number in this sequence: 4, 9, 14, 19, ?, 29, 34, 39, 44.',NULL,NULL,1,'2020-09-06 06:18:54',0,NULL,'2020-09-16 07:29:58'),(9,1,NULL,'Find the missing number in this sequence: 1, 6, 15, 28, ?, 66, 91, 120, 153.',NULL,NULL,1,'2020-09-06 06:18:54',0,NULL,'2020-09-16 07:29:58'),(10,1,NULL,'Find the missing number in this sequence: 1, 2, 6, 24, 120, ?, 5040, 40320, 362880.',NULL,NULL,1,'2020-09-06 06:18:54',0,NULL,'2020-09-16 07:29:58'),(11,1,NULL,'In a family there are six members A, B, C, D, E and F.  A and B are married couple, A being the male member. D is the only son of C who is the brother of A.  E is the sister of D.  B is the daughter-in-law of F whose husband has died.',NULL,'',3,'2020-09-06 06:18:54',0,1,'2020-09-18 10:04:32'),(12,1,NULL,'If C is husband of B, B is daughter of A, A is mother of D and D is a boy, then how D is related to B?',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(13,1,NULL,'If C is brother of B, B is son of A, D is father of C and A is a female, then how A is related to D?',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(14,1,NULL,'Harsh is the father of Santosh, Preeti is the daughter of Beena and Beena is the wife of Harsh.  Santosh is not the daughter of Beena.  Find out the relationship of Santosh and Preeti.',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(15,1,NULL,' P + Q means P is the father of Q; P - Q means P is the wife of Q; P x Q means P is the brother of Q.  Which of the following means A is the maternal uncle of D?     ',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(16,1,NULL,'A + B means A is the daughter of B, A x B means A is the son of B and A - B means A is the wife of B. If T - S x B - M, which of the following is NOT true?',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(17,1,NULL,'A family consists of six members P, Q, R, X, Y, Z.  Q is the son of R but R is not mother of Q. P and R are a married couple.  Y is the brother of R, X is the daughter of P. Z is the brother of Q.  Which symbol represents all the child of P?',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(18,1,NULL,'In a family of 6 (A, B, C, D, E and F) members, there is one married couple with eqqual number of male and female members.  Read the following relations and find out the one from the alternatives. Which is not true for the given family.\r\n\r\n\\emph{Relations:}\r\n\r\n\\begin{itemize}\r\n\\item A and E are sons of F.\r\n\\item D is the mother of a boy and a girl.\r\n\\item B is the son of A.\r\n\\end{itemize}\r\n',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(19,1,NULL,'If P + Q means P is husband of Q, $\\frac{P}{Q}$ means P is the sister of Q, P * Q means P is the son of Q.  How is D related to A in $D * B + \\frac{C}{A}$?',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(20,1,NULL,'Afsana was walking in a desert.  Anwar was passing by riding on a camel.  Afsana requested for a lift.  Anwar said he will give lift only to those who are related to him.  At this, Afsana told him that Anwar\'s mother-in-law is the mother of her mother-in-law.  How is Anwar related to Afsana?\r\n',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(21,1,NULL,'The strait separating Sri Lanka from India is called?',NULL,NULL,2,'2020-09-06 06:18:54',0,2,'2020-09-16 07:29:58'),(22,1,NULL,'Find the missing term: 5, 11, 24, 51, 106, ?',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(23,1,NULL,'Find the wrong term in the series: 3, 8, 15, 24, 34, 48, 63.',NULL,NULL,2,'2020-09-06 06:18:54',0,1,'2020-09-16 07:29:58'),(33,1,NULL,'Let A = {2, 3, 5, 7, 11, 13} and B = {4, 6, 8, 9, 10, 12}.  Choose the correct answer. ',NULL,'Let A = {2, 3, 5, 7, 11, 13} and B = {4, 6, 8, 9, 10, 12}.  Choose the correct answer. ',2,'2020-09-16 08:36:41',0,3,'2020-09-16 11:14:00'),(34,1,NULL,'How do we express the relationship \"x is an element of set A\"?',NULL,'How do we express the relationship \"x is an element of set A\"?',2,'2020-09-16 11:16:26',0,3,'2020-09-16 11:17:58'),(35,1,NULL,'How do we represent \"x does not belong to set A\" or \"x is not an element of set A\"?',NULL,'How do we represent \"x does not belong to set A\" or \"x is not an element of set A\"?',2,'2020-09-16 11:22:09',0,3,'2020-09-16 11:22:46'),(36,1,NULL,'Sets can be represented by which of the following methods?',NULL,'Sets can be represented by which of the following methods?',2,'2020-09-16 11:29:20',0,3,'2020-09-16 11:29:48'),(37,1,NULL,'Which of the following is considered the \"Description Form\" of representation of a set?',NULL,'Which of the following is considered the \"Description Form\" of representation of a set?',2,'2020-09-16 11:31:38',0,3,'2020-09-16 11:32:57'),(38,1,NULL,'Which of the following is considered \"Roster or Tabular Form\" of representation of a set?',NULL,'Which of the following is considered \"Roster or Tabular 