INSERT INTO `ry_qst_notes` VALUES (1,185,1,'The given series is: 14, 24, 41, 65, 96, ?\r\n\r\nThe difference between 24 and 14 is 10.\r\nThe difference between 41 and 24 is 17.\r\nThe difference between 65 and 41 is 24.\r\nThe difference between 96 and 65 is 31.\r\nThe difference series is 10, 17, 24, 31.\r\n\r\nThe difference is always 7. So the next difference would be 38. Hence the answer would be 96+38 which is equal to 134.\r\n',NULL,'2020-09-12 06:20:50'),(2,186,1,'The given sequence is 2, 3, 4, 4, 6, 12, 16, 12, 36, ?, 24. This contains 3 sequences.  The sequence we are interested is 2, 4, 16, ?.  The other two sequences are 3, 6, 12 and 4, 12, 36.  In the sequence we are interested in, the 2nd number is square of the first number, 3rd number is square of the 2nd number and so on.  Hence the answer is 16*16 which is equal to 256.\r\n',NULL,'2020-09-12 06:51:45'),(3,187,1,'The given sequence is 5, 1, 11, 6, 17, 36, 23, ?.  This contains two sequences. The first sequence is 5, 11, 17, 23.  The second sequence is 1, 6, 36, ?.  So we are interested in 2nd sequence.  This sequence is 6<sup>0</sup>, 6<sup>1</sup>, 6<sup>2</sup> and so on.  So the next number in the sequence is 6<sup>3</sup> which is equal to 216. ',NULL,'2020-09-12 06:59:57'),(4,190,1,'The book contains wrong answer.',NULL,'2020-09-12 11:49:48'),(5,210,1,'The pattern is:\r\n\r\n3<sup>3</sup> - 2, 4<sup>3</sup> - 2, 5<sup>3</sup> - 2 and so on.\r\n',NULL,'2020-09-13 07:50:39');
/*!40000 ALTER TABLE `ry_qst_notes` ENABLE KEYS */;
UNLOCK TABLES;

